import React from 'react';
import Nav from 'react-bootstrap/Nav';

const Navbar = () => {
    return(
        <Nav as="ul">
            <Nav.Item as="li">
                <Nav.Link href="/">To-Do App</Nav.Link>
            </Nav.Item>
            <Nav.Item as="li">
                <Nav.Link eventKey="link-1">Link</Nav.Link>
            </Nav.Item>
            <Nav.Item as="li">
                <Nav.Link eventKey="link-2">Link</Nav.Link>
            </Nav.Item>
        </Nav>
    )
}

export default Navbar;
